// https://api.mfapi.in/mf/100049

import { useEffect, useState } from "react";



function App(){
  const[data,setData]=useState(null)
  useEffect(()=>{
    fetch("https://api.mfapi.in/mf/100049")
    .then((res)=>{
      return res.json()
    })
    .then((resp)=>{
      console.log(resp)
      setData(resp)
    })
  })
  return(
    <div>
      <h1>Mutual fund Table</h1>

    </div>
  )
}
export default App;
